export default {
  name: "group-create-container",
  props: {
    next: {
      type: String,
      required: true
    }
  },
  data: function data() {
    return {
      newGroup: this.createNewGroup()
    };
  },
  components: {
    GroupEditor: GroupEditor
  },
  methods: {
    handleSaved: function handleSaved() {
      window.location.assign(this.next);
    },
    createNewGroup: function createNewGroup() {
      var group = new models.Group();
      var ownerId = session.Session.airavataInternalUserId;
      group.members.push(ownerId);
      group.ownerId = ownerId;
      return group;
    }
  },
  computed: {},
